import React, { Component } from 'react';

function UserGreeting(props) {
    return <h1>Bienvenue !</h1>;
}
function GuestGreeting(props) {
    return <h1>Veuillez vous inscrire.</h1>;

}

class Test extends Component {
    render() {
        return (
            <div>
                <h1>Test</h1>
            </div>
        );
    }
}

export default Test;
